Mickey Huff, Khalil Bendib, Project Censored, Peter Phillips, Kristina Borjesson, &quot;Censored 2011: The Top 25 Censored Stories of 2009-10 (Censored: The News That Didn't Make the News -- The Year's Top 25 Censored Stories)&quot;
ISBN: 1583229205 | 2010 | EPUB

The yearly volumes of Censored, in continuous publication since 1976 and since 1995 available through Seven Stories Press, is dedicated to the stories that ought to be top features on the nightly news, but that are missing because of media bias and self-censorship. The top stories are listed democratically in order of importance according to students, faculty, and a national panel of judges. Each of the top stories is presented at length, alongside updates from the investigative reporters who broke the stories.
